import React from "react";
import { reduxForm } from "redux-form";

let ReceiptForm = ({ addReceipt, fields: [{ name, source, time }] }) => {
  return (
    <form onSubmit={addReceipt}>
      <div>
        <input type="text" placeholder="Receipt Name" {...name} />
      </div>
      <div>
        <input type="text" placeholder="Receipt Source" {...source} />
      </div>
      <div>
        <input type="time" placeholder="Receipt Time" {...time} />
      </div>
      <button type="submit">Submit</button>
    </form>
  );
};

export default reduxForm({
  form: "receipt",
  fields: ["name", "source", "time"],
})(ReceiptForm);
// Recipe name
// - Recipe source (where we have obtained the recipe)
// - List of ingredients
// - Preparation time
